import React from 'react';
import DoctorCard from './DoctorCard';

function DoctorGrid() {
  const doctors = [
    { name: 'Dr. Richard James', specialty: 'General Physician' },
    { name: 'Dr. Emily Larson', specialty: 'Gynecologist' },
    { name: 'Dr. Sarah Patel', specialty: 'Dermatologist' },
    { name: 'Dr. Christopher Lee', specialty: 'Pediatrician' },
    { name: 'Dr. Jennifer Garcia', specialty: 'Neurologist' },
    { name: 'Dr. Andrew Williams', specialty: 'Gastroenterologist' },
    { name: 'Dr. Jeffrey King', specialty: 'Pediatrician' },
    { name: 'Dr. Zoe Kelly', specialty: 'Neurologist' },
    { name: 'Dr. Patrick Harris', specialty: 'Gastroenterologist' },
    { name: 'Dr. Chloe Evans', specialty: 'General Physician' },
    { name: 'Dr. Ryan Martinez', specialty: 'Gynecologist' },
    { name: 'Dr. Amelia Hill', specialty: 'Dermatologist' }
  ];

  // Same image source for all doctors for now
  const doctorImage = 'https://cdn.builder.io/api/v1/image/assets/TEMP/67ab25dfbe84419bbec844be527f71efc68b5c6cc9d3cbba8d5699717b1e9e0a?placeholderIfAbsent=true&apiKey=8f0d2cc9bf764b679624a1d309a49f82';

  return (
    <section className="mt-8">
      <h3 className="text-xl font-medium mb-6">All Doctors</h3>
      <div className="grid grid-cols-4 gap-6">
        {doctors.map((doctor, index) => (
          <DoctorCard
            key={index}
            name={doctor.name}
            specialty={doctor.specialty}
            image={doctorImage} // Passing the same image for each doctor
          />
        ))}
      </div>
    </section>
  );
}

export default DoctorGrid;
